import React, { useRef } from "react"
import { Link } from "react-router-dom"
import Logo from "../../resources/images/clariti-logo.png"


export const NavBar = ({ /*token, setToken*/ }) => {
    //const history = useHistory()

    
    return (
        <nav class="topMenu">
            <p>Hi I'm the navbar</p>
            <a className="navbar-item" href="https://clariti-health.com/">
                <img src={Logo}/>
            </a>
            <div className="navbar-item">
                {
                    <Link to="/home" className="navbar-item">Home</Link>
                }
            </div>
            <div className="navbar-item">
                {
                    <Link to="/learn" className="navbar-item">Learn</Link>
                }
            </div>
            <div className="navbar-item">
                {
                    <Link to="/support" className="navbar-item">Support</Link>
                }
            </div>

            <div className="navbar-item">
                {
                    <Link to="/myaccount" className="navbar-item">Username</Link>
                }
            </div>
            <div className="navbar-item">
                <button onClick={() => {
                    console.log("logout clicked")
                        //setToken('')
                        //history.push('/login')
                    }}>Logout</button>
            </div>
        </nav>
    )
}
